import "./Configuracao.css";
import {PatiPiva, Jui, PatoRei, CSA, PalácioT, ConfeitariaC, LaCura, Ofner, GUMILab, Dengo, MicaChocolates, HotelEmiliano, TartuferiaSanPaolo, Eggy, HotelGrandHyatt, Almanara, GrupoRaízes } from "../../assets/images/images";

function Hexagon(){
    return(
    <div className="container">

        <div className="hex poligon pos0">
            <img className="img-sm" alt="PatiPiva logo" src={ PatiPiva } />
        </div>

        <div className="hex poligon pos1">
            <img className="img-xl" alt="Jui logo" src={ Jui }/>
        </div>
        
        <div className="hex pos2"></div>
        <div className="hex pos3"></div>
        <div className="hex pos4"></div>
        <div className="hex pos5"></div>
        <div className="hex pos6"></div>
        
    </div>
    )
}

export default Hexagon;
